(15, 7, 'BBCream - Kem Nn', 'BB cream Face it Power Perfection SPF37 PA++ The Face Shop 40ml ', 'BB-cream-Face-it-Power-Perfection-SPF37-PA---The-Face-Shop-40ml-', 'Xut x: Thefaceshop - Korea', '<p><span style="font-size: small; color: #800080;">BB Cream Face It Power Perfection SPF37 PA++&nbsp; l&agrave; sn phm BB cream chit xut t Omega 3 v&agrave; phc hp vita skin gi&uacute;p th&uacute;c y s sinh sn collagen v&agrave; phc hi da, em li cho bn mt l&agrave;n da tr&agrave;n y sc sng v&agrave; s&aacute;ng khe. </span></p>\r\n<p><span style="font-size: small; color: #800080;"><span style="font-size: small; color: #800080;">Sn phm c&oacute; 2 tone: Tone s&aacute;ng v&agrave; tone t nhi&ecirc;n </span></span></p>\r\n<p><span style="font-size: small; color: #800080;">Thng hiu The Face Shop l&agrave; sn phm bb cream mi nht ang rt a chung tr&ecirc;n th trng H&agrave;n Quc vi nhiu t&iacute;nh nng: l&agrave;m trng da, chng l&atilde;o h&oacute;a v&agrave; chng nhn nhm bo v vi  che ph. BB cream d&ugrave;ng c cho tt c loi da, ch ng gii quyt nhng vn  v da nh da kh&ocirc;, mt  sn chc, da xn m&agrave;u, kt cu da kh&ocirc;ng ng u. </span></p>\r\n<p><span style="font-size: small; color: #800080;">BB cream &ldquo;3 trong 1&rdquo;: l&agrave;m trng da, chng l&atilde;o h&oacute;a v&agrave; chng nhn, bo v da khi &aacute;nh nng mt tri vi  che ph ho&agrave;n ho. Mang li cm gi&aacute;c thoi m&aacute;i, d chu cho da Kt qu trang im tinh t, l&acirc;u d&agrave;i .</span></p>', '', 420000, 'BBTFS03', 1, '0', 0, 0, '1', '1', '1', 1392741013),
(16, 7, 'BBCream - Kem Nn', 'CC Cream Aura Color Control Cream Thefaceshop', 'CC-Cream-Aura-Color-Control-Cream-Thefaceshop', 'Xut x: Thefaceshop - Korea', '<p><span style="font-size: small; color: #800080;">&nbsp;CC Cream l&agrave; mt xu hng trang im mi ca nm 2013, vt mt nhng g&igrave; BB Cream ang nm gi. CC Cream (Color Corrector), c tm dch l&agrave; &ldquo;iu chnh sc m&agrave;u&rdquo;, vi nhng vt tri hn so vi BB Cream:</span><br />&nbsp;<span style="font-size: small; color: #800080;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - t nhi&ecirc;n.</span></p>\r\n<ul>\r\n<li><span style="font-size: small; color: #800080;">CC Cream mng, mn hn BB cream v&agrave; kh nng che ph tt, mang li v p t nhi&ecirc;n.</span></li>\r\n<li><span style="font-size: small; color: #800080;">CC Cream kt cu dng lng, mng, nh, to cm gi&aacute;c d chu, nh nh&agrave;ng hn, kh&ocirc;ng g&acirc;y b&iacute; da.</span></li>\r\n<li><span style="font-size: small; color: #800080;">Nh kt cu lng n&ecirc;n CC Cream iu chnh sc da ho&agrave;n ho hn so vi, nht l&agrave; nhng bn c&oacute; tone m&agrave;u da t&aacute;i xanh hoc l&agrave;n da ngm t nhi&ecirc;n nhi&ecirc;n. V&igrave; c&ocirc;ng dng ca CC Cream l&agrave; iu chnh sc da n&ecirc;n mang n s mt m&agrave; tinh t trong m&agrave;u sc. c bit, bn c&oacute; th phi hp trn chung vi kem nn (Foundation) v&agrave; che khuyt im nu mun </span></li>\r\n<li><span style="font-size: small; color: #800080;">CC Cream tha hng hu nh to&agrave;n b chc nng dng da ca BB cream: c&acirc;n bng  m-chng nng-l&agrave;m trng da.</span></li>\r\n</ul>', '', 420000, 'CCTFS01', 1, '0', 0, 0, '1', '1', '1', 1392741443),
