(36, 3, 'BB Cream - CC Cream - Kem Nn', 'BB Cream Skinfood o v ru sake - BB PEACH SAKE PORE SPF20 PA+', 'BB-Cream-Skinfood-dao-va-ruou-sake---BB-PEACH-SAKE-PORE-SPF20-PA-', 'Xut x : Skinfood - Korea ', '<p><span style="font-size: small; color: #800080;"><strong>BB CREAM SKINFOOD chit xut &agrave;o v&agrave; ru sake - BB PEACH SAKE PORE SPF20 PA+</strong> cho da du, hn hp</span></p>\r\n<p><span style="font-size: small; color: #800080;">Trng lng : 20g</span></p>\r\n<p><span style="font-size: small; color: #800080;">Kem trang im &agrave;o nn vi cu tr&uacute;c l&agrave;m s&aacute;ng da t nhi&ecirc;n v&agrave; gi&uacute;p se kh&iacute;t l ch&acirc;n l&ocirc;ng, cc k&igrave; ph&ugrave; hp cho nhng ai c&oacute; l&agrave;n da du, kim du ho&agrave;n ho, che ph t nhi&ecirc;n mang n cho l&agrave;n da mt v p nh nh&agrave;ng. </span></p>\r\n<p><span style="font-size: small; color: #800080;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - t nhi&ecirc;n.</span><br /><br /><span style="font-size: small; color: #800080;">Hng Dn S Dng: </span><br /><br /><span style="font-size: small; color: #800080;">L&agrave;m sch da mt, thoa mt lng va  l&ecirc;n c&aacute;c v&ugrave;ng tr&ecirc;n khu&ocirc;n mt v&agrave; v nh cho dng cht thm thu v&agrave;o da v&agrave; gi&uacute;p che i khuyt im tr&ecirc;n da, mang li mt l&agrave;n da t nhi&ecirc;n v&agrave; mn m&agrave;ng. </span><br /><br /><span style="font-size: small; color: #800080;">C&oacute; th s dng th&ecirc;m phn ph  lp che ph ho&agrave;n ho v&agrave; mn p nht khi trang im i l&agrave;m hay i tic.</span></p>', '2014_02_19_14_45_43-shopmyphamhan-BB_cream__PEACH_SAKE_PORE.jpg', 190000, 'BBSF03', 1, '0', 0, 0, '0', '1', '1', 1392795943),
(37, 3, 'BB Cream - CC Cream - Kem Nn', ' BB cream chit xut xng rng AGAVE CACTUS SUN BB CREAM SPF36 PA+++ ', '-BB-cream-chiet-xuat-xuong-rong-AGAVE-CACTUS-SUN-BB-CREAM-SPF36-PA----', 'Xut x : Skinfood - Korea ', '<p><span style="font-size: small; color: #800080;"><strong>&nbsp;<span style="font-size: small; color: #800080;">BB Cream Skinfood chit xut xng rng</span> AGAVE CACTUS SUN BB CREAM SPF36 PA+++</strong> ( cho da thng, da kh&ocirc;)</span><br /><br /><span style="font-size: small; color: #800080;">Cha chit xut xng rng Agave gi&uacute;p gi m cho da sut ng&agrave;y, kem chng nng kh&ocirc;ng nhn d&iacute;nh gi&uacute;p l&agrave;m m&aacute;t v&agrave; dng m cho da, ng thi bo v da khi t&aacute;c hi ca tia UV.</span><br /><br /><span style="font-size: small; color: #800080;">Hng dn s dng:</span><br /><br /><span style="font-size: small; color: #800080;">B&oacute;p nh chai v&agrave; d&ugrave;ng u m&uacute;t tr&ecirc;n u chai thoa mt lng va  l&ecirc;n da. Thay mi hoc l&agrave;m sch u m&uacute;t bng nc m sau khi s dng.</span><br /><br /></p>', '2014_02_19_14_49_10-shopmyphamhan-BB_xuong_rong.jpg', 355000, 'BBSF04', 1, '0', 0, 0, '0', '1', '1', 1392796150),
